import React, { Component } from 'react';
import './App.css';
import Login from './Login.js';
import  BrowserRouter  from 'react-router-dom';
import  Route from 'react-router-dom/Route';

class App extends Component {
  render() {
    return (
      <Router>
      <div className="App">
        <Login/>
        <Route path="/" render={
          () => {
            return ( <h1>home</h1>);
          }
        }
      />
      </div>
    </Router>
    );
  }
}

export default App;
